int prod_digit(int a[][],int m,int n)
{for(int i=;i<m;i++)
   { for(int j=;j<n;j++)
       {
           int num=a[i][j];
           int prod=;
           while (num!=)
           {
               int digit=num%;
               prod=prod*digit;
               num/=;
           }
           a[i][j]=prod;
           
       }
       
    
}
}
